        e.preventDefault()
        axios
        .get(`https://www.omdbapi.com/?apikey=959ee6fb&s=${search.value}`)
        .then((res)=>{ console.log(res.data)})
    }

    return (
        <nav >
  <form >
    <input type="search" placeholder="Search" aria-label="Search"/>
    <button type="submit">Search</button>
  </form>
</nav>

    )

}

